import React from "react";
import styled from "styled-components";

function Footer() {
  return (
    <Container>
      <a href="/" className="footer-links">
      <img src="icons/send.png" alt="" className="grey-icon " /> Contact
      </a>
      <p>v2.0</p>
      <a href="/" className="footer-links">
        Instagram
      </a>
    </Container>
  );
}

export default Footer;

const Container = styled.div`
  width: 80%;
  position: absolute;
  display: flex;
  justify-content: space-between;
  align-items: center;
  bottom: 10px;
  color: #575757;
  .footer-links {
    font-size: 0.8em;
    color: #575757;
  }
  p{
    font-size: 0.8em;
  }
  @media (max-width: 639px) {
    width: 90%;
  }
`;
